-- ----------------------------
-- Table structure for dicom_tag
-- ----------------------------
DROP TABLE IF EXISTS `dicom_tag`;
CREATE TABLE `dicom_tag`
(
    `id`                   int                                                           NOT NULL AUTO_INCREMENT,
    `tag_name`             varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT 'Tag标识',
    `coordinates`          char(11)                                                      NOT NULL COMMENT 'Tag标准坐标',
    `tag_value`            varchar(50)                                                   NOT NULL COMMENT '程序对应的Tag值',
    `is_must`              tinyint                                                       NOT NULL DEFAULT '0' COMMENT '是否需要校验,0-无需;1-需要',
    `vr`                   char(2)                                                       NOT NULL COMMENT 'Tag值的数据类型',
    `description`          text COMMENT 'Tag描述',
    `is_need_desensitized` tinyint                                                       NOT NULL DEFAULT '0' COMMENT '是否需要脱敏,0-无需;1-需要',
    `is_need_check`        tinyint                                                       NOT NULL DEFAULT '0' COMMENT '是否需要校验值字典项,0-无需;1-需要',
    `vm`                   varchar(10)                                                            DEFAULT NULL COMMENT '值数量',
    PRIMARY KEY (`id`),
    UNIQUE KEY `flag` (`tag_name`)
) ENGINE = InnoDB
  AUTO_INCREMENT = 4919
  DEFAULT CHARSET = utf8mb4
  COLLATE = utf8mb4_0900_ai_ci;

